// Bluebook.js

import React, { useState } from 'react';
import { createBluebookApi } from '../../apis/Api';

const Bluebook = () => {
  const [bluebookData, setBluebookData] = useState({
    bluebookName: '',
    registrationAuthority: '',
    vehicleClass: '',
    bluebookStatus: '',
    fuelType: '',
    vehicleAge: '',
    registrationDate: '',
    taxValidDate: '',
    taxPaid: '',
    validUpTo: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setBluebookData({ ...bluebookData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await createBluebookApi(bluebookData);
      alert('Bluebook entry created successfully');
      setBluebookData({
        bluebookName: '',
        registrationAuthority: '',
        vehicleClass: '',
        bluebookStatus: '',
        fuelType: '',
        vehicleAge: '',
        registrationDate: '',
        taxValidDate: '',
        taxPaid: '',
        validUpTo: ''
      });
    } catch (error) {
      console.error('Error creating bluebook entry:', error.message);
      alert('Error creating bluebook entry. Please try again.');
    }
  };

  return (
    <div>
      <h2>Create Bluebook Entry</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="bluebookName">Bluebook Name:</label>
          <input type="text" id="bluebookName" name="bluebookName" value={bluebookData.bluebookName} onChange={handleChange} required />
        </div>
        <div>
          <label htmlFor="registrationAuthority">Registration Authority:</label>
          <select id="registrationAuthority" name="registrationAuthority" value={bluebookData.registrationAuthority} onChange={handleChange} required>
            <option value="">Select Registration Authority</option>
            <option value="State 1">State 1</option>
            <option value="State 2">State 2</option>
            <option value="State 3">State 3</option>
            <option value="State 1">State 1</option>
            <option value="State 2">State 2</option>
            <option value="State 3">State 3</option>
            <option value="State 3">State 3</option>
            {/* Add other states as options */}
          </select>
        </div>
        <div>
          <label htmlFor="vehicleClass">Vehicle Class (CC):</label>
          <input type="text" id="vehicleClass" name="vehicleClass" value={bluebookData.vehicleClass} onChange={handleChange} required />
        </div>
        <div>
          <label htmlFor="bluebookStatus">Bluebook Status:</label>
          <select id="bluebookStatus" name="bluebookStatus" value={bluebookData.bluebookStatus} onChange={handleChange} required>
            <option value="">Select Status</option>
            <option value="ACTIVE">Active</option>
            <option value="INACTIVE">Inactive</option>
          </select>
        </div>
        <div>
          <label htmlFor="fuelType">Fuel Type:</label>
          <select id="fuelType" name="fuelType" value={bluebookData.fuelType} onChange={handleChange} required>
            <option value="">Select Fuel Type</option>
            <option value="diesel">Diesel</option>
            <option value="petrol">Petrol</option>
            <option value="electric">Electric</option>
          </select>
        </div>
        <div>
          <label htmlFor="vehicleAge">Vehicle Age (Years):</label>
          <input type="number" id="vehicleAge" name="vehicleAge" value={bluebookData.vehicleAge} onChange={handleChange} min="1" required />
          {/* Min value set to 1 as age cannot be zero */}
        </div>
        <div>
          <label htmlFor="registrationDate">Registration Date:</label>
          <input type="number" id="registrationDate" name="registrationDate" value={bluebookData.registrationDate} onChange={handleChange} min="1900" max="2024" required />
          {/* Add min and max values for the registration year */}
        </div>
        <div>
          <label htmlFor="taxValidDate">Tax Valid Till:</label>
          <input type="date" id="taxValidDate" name="taxValidDate" value={bluebookData.taxValidDate} onChange={handleChange} required />
        </div>
        <div>
          <label htmlFor="taxPaid">Tax Paid:</label>
          <input type="number" id="taxPaid" name="taxPaid" value={bluebookData.taxPaid} onChange={handleChange} required />
        </div>
        <div>
          <label htmlFor="validUpTo">Valid Up To:</label>
          <input type="date" id="validUpTo" name="validUpTo" value={bluebookData.validUpTo} onChange={handleChange} required />
        </div>
        <button type="submit">Create Bluebook</button>
      </form>
    </div>
  );
};

export default Bluebook;
